import React from 'react';

interface Props {
    todos: Todo[];
    changeTodos: ChangeTodos;
}

const Test: React.FC<Props> = ({ todo, changeTodos }) => {
    <li>
        <label style={{ textDecoration: todo.complete ? 'line-through' : undefined }}>
            <input type="checkbox" checked={todo.complete} onClick={() => {changeTodos(todo);}}/> {todo.text}
        </label>
    </li>
}

export const Todos: React.FC<Props> = ({ todos, changeTodos }) => {
  return (
    <>
        {todos.map(todo => (
        <li>
            <label style={{ textDecoration: todo.complete ? 'line-through' : undefined }}>
                <input type="checkbox" checked={todo.complete} onClick={() => {changeTodos(todo);}}/> {todo.text}
            </label>
        </li>
        ))}
    </>
  );
};
